  {
    title: "Який елемент асоціюється з Хаффлпаффом?",
    variants: ["Вітер", "Вогонь", "Земля", "Вода"],
    correct: 2,
  },

  {
    title: "Яку позицію відіграє Гаррі у своїй команді з квідичу?",
    variants: ["Мисливець", "Блуджер", "Переслідувач", "Шукач"],
    correct: 3,
  },

  {
    title:
      "Хто нокаутує троля в жіночій ванній в Гаррі Поттері та Філософському камені?",
    variants: ["Гаррі", "Снейп", "Герміона", "Рон"],
    correct: 3,
  },
];
